```
private IItemWrapper FindChild(string parentPath, string normalizedItemName)
        {
            if (string.IsNullOrWhiteSpace(parentPath))
            {
                return null;
            }

            var children = _context.Database.GetItemWrapper(parentPath).Children;
            return children.FirstOrDefault(
                    child => Helpers.UrlHelper.NormalizePathToSeoFriendly(child.Name)
                          .Equals(normalizedItemName, StringComparison.InvariantCultureIgnoreCase));
        }
